Delayed Functions
Delaying jobs
TypeScript Go Python
You can delay jobs using the
[```
step.sleep()
```](\docs\reference\functions\step-sleep)
method:
Copy Copied
```
import { Inngest } from "inngest" ;

const inngest = new Inngest ({ id : "signup-flow" });

export const fn = inngest .createFunction (
{ id : "send-signup-email" } ,
{ event : "app/user.created" } ,
async ({ event , step }) => {
await step .sleep ( "wait-a-moment" , "1 hour" );
await step .run ( "do-some-work-in-the-future" , async () => {
// This runs after 1 hour
});
}
);
```
For more information on
```
step.sleep()
```
read
[the reference](\docs\reference\functions\step-sleep)
.

